import React from 'react'

function DeleteDetail(props) {
  return (
    <div className="note">
    <h1>{props.name}</h1>
    <p>{props.id}</p>
    <p>{props.startDate}</p>
    <p>{props.endDate}</p>
    <p>{props.floor}</p>
    <button onClick={() => props.onDelete(props.id)}>DELETE</button>
  </div>
  )
}

export default DeleteDetail;
